import React from 'react';
import Navbar from '../components/navbar';
import '../styles/homepage.css'; // Custom styles here
import background from '../assets/final.jpg'; // Import your background image

const HomePage = () => {
  return (
    <div className="homepage" style={{ backgroundImage: `url(${background})` }}>
      <Navbar />
    </div>
  );
};

export default HomePage;
